			return '<div id="plus_thanks_faq_scroll">\n  <div class="scrollbar">\n    <div class="track"><div class="thumb"><div class="end"></div></div></div>\n  </div>\n  <div class="viewport">\n    <div class="overview">\n  \n<h2>Hulu Plus: Frequently Asked Questions</h2>\n \n<p style="margin-top: 10px;">\n  We put together this list of frequently asked questions about the Hulu Plus\n  subscription service. If you have a question that is not answered on this\n  list, please feel free to contact our\n  <a class="blue-link" target="_blank" href="/support/support_form?category=huluplus">customer service team</a>\n  who will be more than happy to answer any questions you may have.\n</p>\n \n<ol class=\'faq-list\'>\n  <li>\n    <span class="faq-question" id="faq-1">\n      What do I get with my Hulu Plus subscription?\n    </span>\n    <div class="faq-answer hidden">\n      <p>\n        Hulu Plus&#0153; lets you watch hit current and back season TV shows and\n        acclaimed movies anytime in HD for $7.99/month with limited\n        advertising. We think of it as a complement to the free service on\n        Hulu.com. For many popular shows on our service, Hulu Plus offers every\n        episode of the current season, not just a handful of recent episodes.\n        Hulu Plus subscribers also have access to back seasons and full runs of\n        some of TV\'s greatest shows, including many that were not available\n        online before.\n      </p>\n      <p> \n        Even better, you can watch Hulu Plus content in HD (when available) on multiple\n        devices, including your laptop, the Apple iPad and iPhone,\n        PlayStation&reg; 3, Roku, and TVs and Blu-ray players from Sony,\n        Samsung and Vizio. (More devices are coming soon.)\n      </p>\n      <p>\n        You can sign up for a 1-week free trial at\n        <a target="_blank" href="/plus?src=faq" class="blue-link">www.hulu.com/plus</a>, or you\n        can also find a sampling of select Hulu Plus content using our free\n        downloadable app for the iPad, iPhone, iPod touch and other supported\n        devices.\n      </p>\n      <ul>\n        <li>\n          Full overview of the Hulu Plus service:\n          <a target="_blank" href="/watch/160617/hulu-walkthrough-what-is-hulu-plus" class="blue-link">Hulu Plus Walkthrough</a>\n        </li>\n        <li>\n          Full list of content providers and shows:\n          <a target="_blank" href="/plus/content" class="blue-link">Hulu Plus Content page</a>\n        </li>\n        <li>\n          Full list of devices and platforms:\n          <a target="_blank" href="/plus/devices" class="blue-link">Hulu Plus Device page</a>\n        </li>\n      </ul>\n    </div>\n  </li>\n\n  <li>\n    <span class="faq-question" id="faq-2">\n      What is the difference between Hulu.com and Hulu Plus?\n    </span>\n    <div class="faq-answer hidden">\n      <p>\n        The Hulu Plus subscription service is the first and only internet video\n        subscription service to stream full current seasons and a deep library\n        of back seasons of hit TV shows from ABC, BET, Comedy Central FOX, NBC,\n        MTV, VH-1 and more, in HD, to computers, internet-connected TVs and\n        Blu-ray players, set-top boxes, mobile phones, and tablets, all for\n        $7.99 per month with limited advertising. There are three key areas of\n        difference between Hulu.com and Hulu Plus subscription service:\n      </p>\n      <ul>\n        <li>\n        <b>Device access</b>. Hulu.com is a free option for users who want to\n        watch TV shows on their computers. Hulu is limited to the PC\n        environment.  Hulu Plus enables users to watch Hulu content instantly\n        in HD (720p) to internet-connected TVs, Blu-ray players, gaming\n        consoles, set-top boxes, iPads, iPhones, and many other devices.  (To\n        see a full list of Hulu Plus enabled devices, please visit: \n        <a target="_blank" href="/plus/devices" class="blue-link">Hulu Plus Device page</a>\n        </li>\n        <li>\n          <b>Content</b>. Generally, Hulu.com offers up to the last five\n          episodes that aired on TV, while Hulu Plus generally offers all\n          current-season episodes from popular shows such as <i>Glee</i>, <i>30\n            Rock</i>, <i>The Daily Show with Jon Stewart</i>, <i>The Colbert\n            Report</i>, <i>House</i>, and <i>Modern Family</i>, and full series\n          runs (all episodes from every season), including <i>The X-Files</i>,\n          <i>Arrested Development</i>, <i>Desperate Housewives</i>,\n          <i>Battlestar Galactica</i>, <i>Monk</i>, <i>Psych</i>, <i>Saturday\n            Night Live</i>, <i>Law &amp; Order: Special Victims Unit</i>,\n          <i>Ugly Betty</i>, <i>Buffy the Vampire Slayer</i>, and dozens more.\n          Hulu Plus is also the exclusive source for the most comprehensive\n          library of the Criterion Collection archive with hundreds of\n          acclaimed films.\n        </li>\n        <li> \n          <b>Video Quality</b>. Hulu.com streams in standard definition\n          while Hulu Plus streams in HD when available.\n        </li>\n      </ul>\n    </div>\n  </li>\n\n  <li>\n    <span class="faq-question" id="faq-3">\n      Why are some of the shows I watch on Hulu not available on devices?\n    </span>\n    <div class="faq-answer hidden">\n      <p>\n        We understand that the content difference can be confusing, and at\n        times frustrating for our users, so we hope this explanation is\n        helpful.\n      </p> \n      <p>\n        For background, when we launched the free Hulu.com service, we\n        obtained licensing to stream content direct to the PC  and only to\n        the PC. With the launch of the subscription-based Hulu Plus service,\n        we had to start from scratch and acquire licensing to stream content\n        on TVs, smartphones, and tablets as well as PCs. We tried to get as\n        much overlap as possible. (We want it all, of course!) But there are\n        still some exceptions that we are working to resolve.\n      </p>\n      <p>\n        Today, Hulu Plus includes hundreds of shows, some of which haven\'t\n        been available online before, and full runs of many of them. (To see\n        a full list please go to\n        <a target="_blank" href="/plus/content" class="blue-link">Hulu Plus Content page</a>\n      </p>\n      <p>\n        Still, we understand it\'s disappointing when you can\'t access some of\n        your favorite shows on your favorite devices. Please know that we are\n        working diligently to include as much content as possible in Hulu\n        Plus so you can enjoy more of your favorite shows where and when you\n        want, and we\'re confident the offering will improve over time.\n      </p>\n    </div>\n  </li>\n\n  <li>\n    <span class="faq-question" id="faq-4">\n      I heard there are ads on Hulu Plus. Why?\n    </span>\n    <div class="faq-answer hidden">\n      <p>\n        We include advertisements in Hulu Plus in order to reduce the monthly\n        subscription price of the service. Premium content &mdash; especially\n        from the current TV season &mdash; is not only expensive to make and\n        license, but we also want to compensate our content partners fairly\n        for the valuable entertainment they provide.\n      </p>\n      <p>\n        Hulu Plus offers what no other streaming content service on the\n        market today can: all current season episodes of popular shows like\n        <i>Glee</i>, <i>House</i>, and <i>Modern Family</i>,\n        and full series runs (all episodes from every season) of popular\n        library shows, including <i>The X-Files</i>, <i>Arrested\n        Development</i>, <i>Desperate Housewives</i>, <i>Battlestar\n        Galactica</i>, <i>Monk</i>, <i>Psych</i>, <i>Saturday Night\n        Live</i>, <i>Law &amp; Order: Special Victims Unit</i>, <i>Ugly\n        Betty</i>, <i>Buffy the Vampire Slayer</i>, and many more.\n      </p>\n      <p>\n        We have found that by including a modest ad load, we can keep the price\n        for Hulu Plus under eight bucks, while still providing users with\n        access to the most popular current season shows on the devices of\n        their choice.\n      </p>\n      <p>\n        We\'re continually working to tailor the ad experience to your\n        interests in an effort to make the advertising you see on Hulu Plus\n        more relevant and useful to you. In addition, we are always\n        evaluating new business models, including the option of a higher\n        priced, ad-free model.\n      </p>\n    </div>\n  </li>\n\n  <li>\n    <span class="faq-question" id="faq-5">\n      When will my device have the Hulu Plus app available?\n    </span>\n    <div class="faq-answer hidden">\n      <p>\n        For a list of devices currently enabled with Hulu Plus, please visit our\n        <a target="_blank" href="/plus/devices" class="blue-link">Hulu Plus Device page</a>\n        You\'ll also find devices that are coming soon listed there\n        &mdash; and you can sign up to be notified when they do become\n        available.\n      </p>\n      <p>\n        We have plans to bring Hulu Plus to as many devices as possible, and\n        we are continually evaluating new technologies and will add more\n        devices based on user demand.\n      </p>\n    </div>\n  </li>\n\n  <li>\n    <span class="faq-question" id="faq-6">\n      What are the system requirements for Hulu Plus?\n    </span>\n    <div class="faq-answer hidden">\n      <p>\n        To find the system requirements for your PC or other devices, please visit our\n        <a target="_blank" href="/support/article/197541" class="blue-link">help article</a>\n      </p>\n    </div>\n  </li>\n\n  <li>\n    <span class="faq-question" id="faq-7">\n      Does the same subscription work on every enabled device?\n    </span>\n    <div class="faq-answer hidden">\n      <p>\n        Yes, your subscription follows you to any Hulu Plus enabled device.\n        For example, you can start an episode of <i>Glee</i> on your\n        iPhone and finish it up on your Samsung internet-connected TV, all\n        for just $7.99 a month with limited advertising.\n      </p>\n    </div>\n  </li>\n\n  <li>\n    <span class="faq-question" id="faq-8">\n      Can I access Hulu outside of the US?\n    </span>\n    <div class="faq-answer hidden">\n      <p>\n        Unfortunately, Hulu is only accessible within the US and Japan at this\n        time, as we only have streaming rights for our content in these regions.\n        Click <a target="_blank" href="http://www.hulu.jp" target="_blank">here</a> to learn\n        more about Hulu Japan.\n      </p>\n    </div> \n  </li>\n\n  <li>\n    <span class="faq-question" id="faq-9">\n      How many devices can I watch Hulu Plus on at once?\n    </span>\n    <div class="faq-answer hidden">\n      <p>\n        Hulu Plus is intended as a personal account, and only one\n        simultaneous stream is allowed.\n      </p>\n    </div>\n  </li>\n</ol>\n\n    </div>\n  </div>\n</div>\n';
